import { landingPageDTO } from './movies/movies.module.d';
import IndexGenres from "./genres/IndexGenres";
import LandingPage from './movies/LandingPage';

const routes = [
    {
        path: '/genres',
        component: IndexGenres
    },
    {
        path: '/',
        component: LandingPage,
        exact: true
    }
];

export default routes;
